import React from "react";
import "./index.css";

const chordsData = [
  { name: "C Major", image: "../../assets/chords/c_major.png" },
  { name: "D Major", image: "../../assets/chords/d_major.png" },
  { name: "E Minor", image: "../../assets/chords/e_minor.png" },
  { name: "F Major", image: "../../assets/chords/f_major.png" },
  { name: "G Major", image: "../../assets/chords/g_major.png" },
  { name: "A Minor", image: "../../assets/chords/a_minor.png" },
  { name: "B Major", image: "../../assets/chords/b_major.png" },
];

export default function Chords() {
  return (
    <div className="chords-page">
      <h1 className="chords-title">Guitar Chords</h1>
      <section className="chords-section">
        {chordsData.map((chord, index) => (
          <div key={index} className="chord-card">
            <img src={chord.image} alt={chord.name} />
            <p>{chord.name}</p>
          </div>
        ))}
      </section>
    </div>
  );
}
